import React, { Component } from 'react';
import axios from "axios"
import { withStyles } from '@material-ui/core/styles';
import TableContainer from '@material-ui/core/TableContainer';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import InputBase from '@material-ui/core/InputBase';
import { lighten, makeStyles, fade, useTheme } from '@material-ui/core/styles';

import {
  userContext, getUserOwnerRestaurant,
  getUserCount, getUserAll
} from '../utils/userContext';
const styles = theme => ({
  backdrop: {
    zIndex: theme.zIndex.drawer + 1,
    color: '#fff',
  },
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  content: {
    padding: 0
  },
  item: {
    padding: theme.spacing(3),
    textAlign: 'center',
    [theme.breakpoints.up('md')]: {
      '&:not(:last-of-type)': {
        borderRight: `1px solid ${theme.palette.divider}`
      }
    },
    [theme.breakpoints.down('sm')]: {
      '&:not(:last-of-type)': {
        borderBottom: `1px solid ${theme.palette.divider}`
      }
    }
  },
  titleWrapper: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  },
  label: {
    marginLeft: theme.spacing(1)
  },
  overline: {
    marginTop: theme.spacing(1)
  },
  paperModal: {
    position: 'absolute',
    marginLeft: "33%",
    marginTop: "5%",
    width: '33%',
    height: 540,
    backgroundColor: "#fff",
    border: 'none',
  },
  search1: {
    flexDirection: 'row',
    width: 300,
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: '#FFF',
    elevation: 6,
    '&:hover': {
      backgroundColor: fade('#FFF', 0.8),
    },
    marginRight: theme.spacing(2),
    marginBottom: theme.spacing(2),
    marginTop: 16,
    [theme.breakpoints.up('sm')]: {
    },
  },
});
const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '75ch',
    },
  },
}));
class ServiceFee extends Component {
  constructor(props) {
    super(props)
    this.state = {
      food: '',
      experience: '',
      user: '',
      experience1: ""
    }
  }
  componentDidMount = async () => {
    let user = await userContext();
    if (user != null) {
      this.setState({
        user: JSON.parse(user),
        isLogin: true,
      })
    } else {
      // back him login
      this.setState({
        isLogin: false
      })
    }
    let countUser = await getUserCount();
    this.setState({
      countUser: countUser[0].userDataLength
    }, () => {
      // console.log("CountUser", countUser[0].userDataLength )
    })

    // Call user
    let customer = await getUserAll(20, 19);

    let customerToCsv = [];
    for (let cus in customer) {
      delete customer[cus].password_user;
      customerToCsv.push(customer[cus])
    }

    if (customer.length > 0) {
      this.setState({
        customer: customer,
        filterResultCustomers: customer,
        showProgress: false,
        customerToCsv: customerToCsv
      })
    }
    let customerOwner = await getUserOwnerRestaurant(this.state.user.token);
    if (customerOwner.length > 0) {
      this.setState({
        customerOwner: customerOwner,
        showProgress: false
      })
    }
    // console.log("Customer owner ", customerOwner)
  }
  render() {
    const { classes } = this.props;

    return (
      <>
        <TableContainer style={{
          marginTop: 80,
          paddingLeft: 20,
          paddingRight: 20,
          width: window.innerWidth - 300,
        }}>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              alignItems: "center",
              justifyContent: "space-between"
            }}>
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                alignItems: "center",
              }}
            >
              <div style={{ display: "flex" }}>

                <InputBase
                  type="text"
                  name="search"

                  placeholder="Resturant ID"
                  classes={{
                    root: classes.inputRoot,
                    input: classes.inputInput1,
                  }}
                  inputProps={{ 'aria-label': 'search' }}
                  onChange={this.handleInputChange}

                />
                <InputBase
                  type="text"
                  name="search"

                  placeholder="Service Fee"
                  classes={{
                    root: classes.inputRoot,
                    input: classes.inputInput1,
                  }}
                  inputProps={{ 'aria-label': 'search' }}
                  onChange={this.handleInputChange}

                />

              </div>
              <Button variant="contained" color="primary"
                onClick={this.onSearch}
              >
                SEARCH
            </Button>
            </div>
            {/* 
            <FormControlLabel
              label ="FILTER"
                control={
                  <IOSSwitch
                    checked={this.state.checkedB}
                    onChange={this.handleChangeIOS('checkedB')}
                    value="checkedB"
                  />
                }
            /> */}
          </div>
          <div>
            <Table
              component={Paper} aria-label="customized table">

              <TableRow style={{
                backgroundColor: "#fff"
              }}>
                <TableCell> <b>Restaurants Service list</b> </TableCell>
                <TableCell>  </TableCell>
                <TableCell>  </TableCell>
              </TableRow>

              <TableRow style={{
                backgroundColor: "#eeefff"
              }}>
                <TableCell>  Name </TableCell>
                <TableCell align="left">Service Fee</TableCell>

                <TableCell align="left">Actions</TableCell>


              </TableRow>



            </Table>

          </div>
        </TableContainer>
      </>
    )
  }
};

export default withStyles(styles)(ServiceFee)
